import React from 'react';
import './styles.css'



function Header() {
    return (
        <header className="containerHeader">
            <ul id="menu-navigation-header" >
                <li>PORTFOLIO</li>
                <li>ABOUT</li>
                <li>SERVICES</li>
                <li>CONTACT</li>
            </ul>
            <div id="content">
                <img id="picture-profile" src="https://avatars0.githubusercontent.com/u/42282908?s=460&u=79ce909209ebf14da91a2d2517c9b0f9e378a4e1&v=4" alt="picture profile" />
            </div>
        </header>
    )
}

export default Header;
